import React from 'react'
import {AppBar,Toolbar} from '@mui/material';
import AddUsers from './AddUsers.';
import EditUser from './EditUser';
import AllUser from './AllUser';
function NavBar() {
  return (
    <>
        <AppBar>
        <Toolbar>
            <AddUsers></AddUsers>
            <EditUser></EditUser>
            <AllUser></AllUser>
        </Toolbar>
        </AppBar>
    </>
  )
}

export default NavBar
